import React from "react";
import "./Sidebar.css";
import User from "../containers/User";

const Sidebar = ({ contacts }) => {
	return (
		<aside className="sidebar">
			{
				contacts.map(
					contact => alert({contact})
				)
			}
		</aside>
	);
}

export default Sidebar;
